import React, {Component} from 'react'
import Layout from "../../components/templates/layouts";
import {Hero} from '../../components/organisms'
import ImageHero from '../../assets/illustrations/daily-stories.svg'
import {SliderHero} from '../../components/organisms'
import Resizable from '../../components/organisms/articles/sliderHero/slide.jsx'

import {View} from '../../components/atoms';
import {FlickingEvent, SelectEvent, ChangeEvent, NeedPanelEvent} from "@egjs/flicking";
import Flicking from "@egjs/react-flicking";
import {Parallax, Fade, AutoPlay} from "@egjs/flicking-plugins";

class Stories extends Component {

  render() {

    return ( <> <Layout title="Stories">
      <Hero
        title="Stories Resources"
        subtitle="The more that you read the more things you will know."
        img={ImageHero}/> {/* <SliderHero/>     */}
      <View width="800px">
        <Flicking
          tag="div"
          viewportTag="div"
          cameraTag="div"
          classPrefix="eg-flick"
          deceleration={0.0075}
          horizontal={true}
          circular={false}
          infinite={false}
          infiniteThreshold={0}
          lastIndex={Infinity}
          threshold={40}
          duration={100}
          panelEffect=
          {x => 1 - Math.pow(1 - x, 3)}
          defaultIndex={0}
          inputType={["touch", "mouse"]}
          thresholdAngle={45}
          bounce={10}
          autoResize={false}
          adaptive={false}
          zIndex={2000}
          bound={false}
          overflow={false}
          hanger={"50%"}
          anchor={"50%"}
          gap={0}
          moveType={{
          type: "snap",
          count: 1
        }}
          collectStatistics={true}>
          <div>panel 0</div>
          <div>panel 1</div>
          <div>panel 2</div>
        </Flicking>
      </View>
    </Layout> < />
        )
    }
}

export default Stories;
